Insert Into category_afield_tblc ( catId, aFieldId, orderLnNo, isMndt, aFieldLen, aFieldVLen, aFieldMaxLen )
Select
	catId,
	t5.aFieldId,
	orderLnNo,
	'F', 20, 3, decode(x1.typeCd, 'Currency', 9, 'Number', 9, 150) FROM
	(
	Select 'c_gjcity' catId,
		'gjdate' aFieldId,
		'1' orderLnNo
	From copy_tblc ct
	Where ct.no1 <= 1
	) t5,
	afield_tblc x1
Where
	t5.afieldId = x1.afieldId
	and Not exists ( Select 1 From category_afield_tblc t6 Where t6.aFieldId = t5.aFieldId and t6.catId = t5.catId )
/
