INSERT INTO TG_SCRIPT
  (SEQ_NO,DAY,CATE_CODE,TITLE,TITLE_CATE,TYPE_CODE,DEPT_CODE,WRITER,REMARKS,DOCUMENT,FILE_NAME,SEAR_RANK,ADMIN_ID,WRITE_IP,VIEW_CNT)
VALUES(3379,'20020720','AC52','전남대학교병원 소식지 기고문','자','AT06','AD05','나하나',null,'  "꿈이 있는 빛고을, 우리 모두가 주인"
 먼저, 21세기 개혁과 변화의 시대에, 새로운 광주를 건설해야 하는 시점에서, 시장이라는 중책을 맡을 수  있도록 저를 성원해주신 황태주 병원장님을 비롯한 전남대학교병원 가족여러분에게 깊은 감사를 드립니다.
전남대병원은 1910년 자혜의원을 시작으로 100여년 가까이 시민과 생사고락을 같이 해온 건강지킴이입니다.
또한, 국내최초, 세계최초가 붙은 많은 선진의료기술을 보유하고 있어 우리 고장의 자랑이요, 시민들의 복지 현주소라 해도 과언이 아닐 것입니다.
급변하는 의료환경 등 어려움도 많았지만, 생명존중의 이념하나로 이를 극복해온 의료진과 임직원 여러분에게 140만 광주시민과 함께 깊은 감사를 드립니다.
존경하는 전남대학교병원 가족 여러분!저는 우리지역의 발전 가능성에 대한 확신을 가지고 있습니다. 우리는 2002월드컵경기를 치르면서 우리 민족의 무한한 잠재력과 단합된 힘을 확인하였습니다. 그 힘으로 4강신화를 일궈냈고 그 중심에는 광주가 있었기 때문입니다.
저는 이러한 광주를 세계속에 우뚝서는 첨단산업의 도시, 문화예술의 도시로 만들어 나가고자 합니다.
무엇보다도 지역경제를 살리기 위해, 광산업과 디자인  산업, 첨단부품·소재 산업 등 고부가가치 첨단산업을  우리 광주의 핵심 전략산업으로 육성할 것입니다.
기존의 주력산업인 자동차와 전자부문의 부품소재 산업도 적극 육성하면서 연간생산 50만대 규모의 승용차 생산라인을 유치할 계획입니다.
또, 산업인프라를 확충하고 입주여건을 개선하는 등 기업하기 좋은 여건을 만들어 투자를 적극 유치할 것입니다.
뿐만 아니라, 시민 여러분께서 건강하고 안정된 생활을 영위할 수 있도록 하는 데에도 소홀함이 없도록 하겠습니다.
무의탁자, 저소득 母·父子가정, 소년소녀가정 등에 대한 생계안정과, 근로능력자에 대한 자활활동을 촉진하고 장애인복지를 향상시키는등 저소득·취약계층의 생활을 보장하겠습니다.
아울러, 홀로 사는 노인에 대한 무료건강진단 및 식사 제공과 경로당에 대한 순회간호사제도 운영 등으로 노후생활 안정을 도모해 나가겠습니다.
그렇지만, 우리 공직자의 힘만으로는 이러한 복지사회, 부자도시의 꿈은 이룰 수 없습니다. 그동안 사회공익활동에도 앞장서오신 전남대병원가족 여러분께서 의지를 새롭게 가다듬고 광주발전을 위해 다함께 동참해 주시기를 바랍니다.
앞으로도, 전남대병원이 우리 시민들의 건강을 지키고 삶의 질을 향상시키는데 더욱 앞장서 주시기를 기대하면서, 전남대학교 병원의 무궁한 발전을 기원합니다.
감사합니다.',null,'A','admin','211.253.121.18',4)
/
INSERT INTO TG_SCRIPT
  (SEQ_NO,DAY,CATE_CODE,TITLE,TITLE_CATE,TYPE_CODE,DEPT_CODE,WRITER,REMARKS,DOCUMENT,FILE_NAME,SEAR_RANK,ADMIN_ID,WRITE_IP,VIEW_CNT)
VALUES(3376,'20020719','AC53','시립도서관 디지털자료실 개실 인사말씀','사','AT08','AD01','나하나',null,' 오늘, 호남지역 최대의 공공도서관인 우리시 시립도서관에서, 지역정보화의 큰 축을 담당할 ''디지털 자료실''이 문을 열게 된 것을 대단히 기쁘게 생각합니다.
그동안 아낌없는 성원을 보내주시고, 바쁘신 가운데에도 참석해주신 시민 여러분과, 이종일 운영위원장님을 비롯한 도서관 운영위원 여러분, 강박원 시의회 부의장님,  김재균 북구청장님, 지역내 공공·대학도서관 관장님을 비롯한 내빈 여러분께도 감사를 드립니다.
잘 아시겠지만, 그동안 도서관은 책을 중심으로 해서, 지식정보를 수집하고 서비스하는 사회 기관이었습니다.
그렇지만, 최근 인터넷 등 정보통신 기술이 발달하면서,지식정보는 이제, 책은 물론이고 다양한 형태의 매체를 통해 빠르게 보급되고 있습니다.
이러한 흐름에 부응하면서 시민 여러분에게 한 발더 다가가기 위해, 우리시는 국비를 포함한 총13억원의 예산을 들여서, 다양한 디지털 정보를 제공하는 본 자료실을 준비해 온 것입니다.
이 자료실은, 초고속 통신망을 통해 정보검색을 하거나, 멀티미디어 컨텐츠를 활용한 학습을 할수 있도록 꾸며져 있습니다. 또, 주5일 근무제실시를 앞두고 시민들의 여가와 자기개발을 위한 문화공간으로도 제공될 것입니다.
앞으로도 시민 여러분께서, 이러한 자료실과 21세기형 도서관으로 거듭난 우리 시립도서관을 많이 이용해주시기를 바랍니다.
모쪼록, 디지털자료실이 시민 여러분의 사랑속에서 지식의 寶庫로 자리잡고, 나아가 우리 시가 지식정보시대에 앞서 나가면서 세계적인 첨단산업의 도시가 되는데 밑거름이 되어 주기를 기대합니다.
끝으로, 오늘이 있기까지 많은 애를 써 주신 강석관 시립도서관장님과 관계 공무원 여러분, 공사를 맡아주신 관계인사 여러분에게도 격려의 말씀을 드리면서, 자리를 함께 해주신 여러분 모두의 건강과 행운을 기원합니다.
감사합니다.
',null,'O','admin','211.253.121.18',19)
/
INSERT INTO TG_SCRIPT
  (SEQ_NO,DAY,CATE_CODE,TITLE,TITLE_CATE,TYPE_CODE,DEPT_CODE,WRITER,REMARKS,DOCUMENT,FILE_NAME,SEAR_RANK,ADMIN_ID,WRITE_IP,VIEW_CNT)
VALUES(3377,'20020719','AC48','한국민속예술축제 시예선대회','하','AT04','AD01','나하나',null,'존경하는 대회 참가자 여러분! 그리고 내빈 여러분!
먼저, 한국민속예술축제 시 예선대회가 열리게 되어 대단히 기쁘게 생각합니다. 땀흘려 준비해주신 모든 참가팀과, 주관해주신 전국문화원연합회 강명보 지회장님을 비롯한 관계인사 여러분에게 감사를 드립니다.
우리는 월드컵을 치르면서 민족의 무한한 가능성과 단합된 힘을 확인하였습니다. 그래서, 4강 신화를 달성할수 있었고, 자랑스러운 광주가 그 중심에 서 있었습니다.
한, 월드컵 문화행사때 펼쳐진 고싸움 등 독특한 우리 문화는 세계의 이목을 끌기에 충분하였습니다.
따라서, 이러한 자긍심과 일체감을 사회발전의 에너지로 승화시키는데, 민속예술이 크게 기여할 것으로 봅니다.
예로부터 민속놀이와 민요 등은 노동의 피로를 풀어주고 마을 주민간에 화합하는 계기가 되었기 때문입니다.
한, 21세기를 맞아 문화와 예술은 영상, 관광산업 등과 결합하면서 엄청난 부가가치를 창출하고 있습니다.
이러한 점에서, 조상의 얼이 있는 민속예술에 보다 많은 관심을 기울여야 할 때입니다.
우리 시로서도 義, 藝, 味 등 전통이미지와 4강신화로 격상된 광주브랜드를 관광자원으로 적극 활용하고, 전통문화관광단지등을 조성하여 많은 국내외 관광객이 찾도록 할 생각입니다.
지난 월드컵에서 수준높은 한국축구와 응원문화로 세계를 놀라게 한 것처럼, 독창적인 우리문화, 남도 특유의 민속예술로 세계를 한번 더 놀라게 합시다.
축제에 참가하신 여러분께서도 이처럼 소중한 문화자산인 민속예술의 발전에 한몫을 하고 계시다는 긍지를 갖고서, 앞으로도 이를 발전시키는데 앞장서 주시기를 바랍니다.
이번 대회를 통해, 훌륭한 민속문화가 재창조되고 나아가 오는 10월, 전국 대회에서 좋은 결실을 거두어 우리 광주의 문화역량을 과시할 수 있기를 기대하면서, 참가자 여러분의 건승을 기원합니다. 감사합니다.
',null,'O','admin','211.253.121.18',22)
/
INSERT INTO TG_SCRIPT
  (SEQ_NO,DAY,CATE_CODE,TITLE,TITLE_CATE,TYPE_CODE,DEPT_CODE,WRITER,REMARKS,DOCUMENT,FILE_NAME,SEAR_RANK,ADMIN_ID,WRITE_IP,VIEW_CNT)
VALUES(3378,'20020720','AC17','좋은 글 보내기운동 기고문','자','AT06','AD01','나하나',null,'사랑하는 청소년 여러분!
안녕하십니까. 광주광역시장 박광태입니다.
2002 월드컵을 치르면서 우리는 하나가 되었습니다.  한국대표팀의 선전과, 열정적이면서도 질서있던 응원문화는 전 세계에 한국의 힘을 보여주기에 충분하였습니다.
또한, ''꿈★은 이루어진다''라는 붉은악마의 카드섹션처럼 월드컵은 우리에게 큰 희망과 자신감을 심어주었습니다.
그렇습니다. 꿈은 이루어집니다. ''디즈니랜드''는 월트 디즈니의 꿈에서, 하늘을 날고 달에 인간의 발자욱을 남긴것도 오랜 인류의 꿈에서 나오지 않았습니까. 그리고 ''위대한 유산''의 ''짐 스토벌''은 꿈은 계속해서 키워나가는 것이라고 지적합니다.
청소년 여러분! 작은 꿈이든 큰 꿈이든 꿈을 가지십시오. ''내 인생의 주인공은 나''라는 자신감으로 땀을 흘리고  실력을 쌓으십시오. 여러분의 꿈은 반드시 이루어질 것입니다. 저도 여러분과 함께 열심히 뛰겠습니다.
우리 광주에도 꿈이 있기 때문입니다. 민선3기 시정목표는 ''꿈이 있는 빛고을, 우리 모두가 주인''입니다. 광주시민이 꿈과 주인의식을 갖고서 세계속에 일류 광주를 함께 만들어 가자는 뜻입니다.
활력있는 지역경제, 믿음주는 열린행정, 격조있는 문화도시, 함께 하는 시민복지, 이것이 바로 제가 시민 여러분께 함께 이루고 싶은 광주의 구체적인 꿈입니다.
모든 시민의 화합을 바탕으로 우리 모두가 주인이 되어 지역현안을 하나하나 해결해 나간다면 우리 빛고을의 꿈은 머지않아 이루어 질 것으로 확신합니다.
이와 함께, 우리시는 청소년 여러분이 행복해지고 바르게 성장할 수 있는 환경을 마련하고 있습니다. 청소년인권센터와 종합상담실, 청소년 창안제 등을 운영하고  있으니, 여러분도 많이 이용해주시기 바랍니다.
끝으로, 그동안 난치병에도 굴하지 않고 "좋은 글 보내기 운동"처럼 뜻깊은 사회활동을 펼치고 계시는 옥래헌 선생님께 깊은 감사를 드립니다. 진심으로 쾌유를 빕니다.
',null,'O','prgwangju','102.1.2.108',37)
/
INSERT INTO TG_SCRIPT
  (SEQ_NO,DAY,CATE_CODE,TITLE,TITLE_CATE,TYPE_CODE,DEPT_CODE,WRITER,REMARKS,DOCUMENT,FILE_NAME,SEAR_RANK,ADMIN_ID,WRITE_IP,VIEW_CNT)
VALUES(3375,'20020719','AC07','MBC노래열전 -광주시청편-','00','AT08','AD05','나하나',null,' 오늘, 우리 광주시청의 공무원 여러분을 위한 ''광주MBC 노래열전''이 방송되어 대단히 기쁘게 생각합니다.
제가 민선3기 광주시장으로 취임한지도 한달이 돼갑니다. 그동안 ''시민과의 대화''나 많은 현장방문으로 바쁘기만 했는데, 제가 오늘 이렇게 예심도 받지 않고 무대에 오른 것을 보면, 시장 되기를 참 잘했다는 생각이 듭니다.
이 기회를 빌려서, 저를 지지해주신 광주시민 여러분과, 또 저와 함께, 어떻게 하면 광주가 부자도시가 되고, 세계적인 문화도시가 될까, 고민하면서 열심히 일하고 있는 6천여 공직자 여러분에게 감사를 드립니다.
또, 광주문화방송이 방송을 통해 삶의 질을 높이고 시정발전을 도와주고 계신데 대해서도 고맙게 생각합니다.
지난 월드컵때, 우리는 대한민국, 오 필승 코리아!를 외치면서, 온 국민이 하나가 되고, 4강신화를 이뤘습니다.
이처럼, 함께 노래불렀던 오늘도 그동안 쌓인 스트레스를 말끔히 털고, 부서간에, 가족간에, 또 시청하고 계시는 시민 여러분까지도 화합하고 새 힘을 얻는 좋은 시간이 되었기를 바랍니다.
자, 우리 열심히 또 뜁시다. "꿈이 있는 빛고을 우리 모두가 주인" 되는 그러한 광주를 향해서!  대단히 감사합니다.
',null,'O','prgwangju','102.1.2.108',21)
/
INSERT INTO TG_SCRIPT
  (SEQ_NO,DAY,CATE_CODE,TITLE,TITLE_CATE,TYPE_CODE,DEPT_CODE,WRITER,REMARKS,DOCUMENT,FILE_NAME,SEAR_RANK,ADMIN_ID,WRITE_IP,VIEW_CNT)
VALUES(3373,'20020715','AC12','한국여성경제인협회지회 창립3주년기념식','하','AT01','AD03','나하나',null,' 존경하는 이영숙 협회장님, 김광아 지회장님을 비롯한 회원 여러분! 그리고 자리를 함께 하신 조시용 광주전남중소기업청장님, 김재철 전라남도 행정부지사님을 비롯한 내빈 여러분!
오늘, 한국여성경제인협회 광주전남지회가 창립 3주년을 맞게 된 것을 진심으로 축하드립니다.
먼저, 아직도 사회 곳곳에 남아있는 많은 제약을 극복하고, 국가와 지역경제의 발전에 앞장서오신 여성경제인 여러분에게 깊이 감사를 드립니다. 모범적인 기업운영으로 영예로운 상을 수상하신 분들에게도 아낌없는 축하의 박수를 보냅니다.
며칠 전, 여성계에 큰 경사가 있었습니다. 지난 개각때 ''장 상'' 전 이화여대 총장이 국무총리서리에 기용되면서 헌정사상 처음으로 여성 총리가 탄생한 것입니다.
이는, ''국민의 정부''들어, 여성의 힘을 국가경쟁력으로 인식하고 제도개선에 박차를 가한 정부와, 여성 스스로의 자각, 그리고 사회적인 공감이 만들어낸 결실이라고 생각합니다.
이러한 성과를 바탕으로 여성들의 사회참여가 더욱 활발해지고 권익이 향상되는 계기가 되어야 하겠습니다. 우리 시로서도 지역여성의 삶의 질을 높이기 위한 시책을 다양하게 추진하면서 여성여러분의 목소리를 시정에 적극 반영할 것입니다.
잘 아시겠지만, 우리 지역의 가장 큰 현안은 경제를 살리는 일입니다.
우리시는 光산업과 디자인산업, 첨단부품 소재산업을 3대 핵심전략산업으로 육성해 나가면서, 산업인프라 확충과 입주여건의 개선 등 기업하기 좋은 여건을 만들어 투자유치에 적극 나설 것입니다.
이렇게, 산업이 발달하면 여성의 고용이 자연히 늘 것이고 여성복지 차원에서도 긍정적인 영향을 미치게 될 것입니다.   부디 우리 광주가 생산도시, 부자도시로 탈바꿈할 수 있도록 여성경제인 여러분께서 협력하여 주시기를 당부드립니다.
최근 KOTRA가 98개국의 외국인에게 한국상품의 구매이유를 물었다고 합니다. 그런데 ''품질이 좋아서''는 38%인데, ''가격이 싸서''는 35%이었습니다. 우리는 지금 한국상품의 앞선 품질이 당당하게 인정을 받는 그 출발점에 서있는 것입니다.
더욱이, 우리나라 축구대표팀이 전 국민의 힘찬 함성속에서 월드컵 4강신화를 달성하였습니다. 조용한 아침의 나라에서 활기가 넘치는 한국으로 국가인지도가 높아졌습니다.
FIFA랭킹 40위였던 한국이 기본기가 충실한 플레이로 세계 4위가 된 것처럼, 우리기업들도 원칙을 중시하는 경영과 근성있는 품질개발로 다시 한번 세계를 깜짝 놀라게 해주십시오
앞으로도, 正道에 충실하고 21세기 지식경영에 한발 앞서나가고 있는 여러분께서, "꿈이 있는 빛고을, 우리 모두가 주인" 되는 광주를 건설하는데 앞장서 주실 것으로 믿으면서, ''한국여성경제인협회 광주전남지회''의 무궁한 발전을 기원합니다.
감사합니다.
',null,'O','admin','211.253.121.18',27)
/
INSERT INTO TG_SCRIPT
  (SEQ_NO,DAY,CATE_CODE,TITLE,TITLE_CATE,TYPE_CODE,DEPT_CODE,WRITER,REMARKS,DOCUMENT,FILE_NAME,SEAR_RANK,ADMIN_ID,WRITE_IP,VIEW_CNT)
VALUES(3374,'20020717','AC43','서혜경 피아노리사이틀','사','AT01','AD01','나하나',null,' 민선 3기 지방자치 출범을 기념하는 서혜경씨의 피아노 리사이틀이 열리게 된 것을 대단히 뜻깊게 생각합니다. 주최하느라 노고가 크셨던 ''무등일보''의 김정수 사장님을 비롯한 관계인사 여러분에게 감사를 드립니다.
21세기 개혁과 변화의 시대에, 발전과 번영의 새로운 광주를 건설해야 하는 이 시점에서, 시장이라는 중책을 맡을 수 있도록 저를 성원해주신 여러분께 깊은 감사를 드립니다.
저는 우리 광주를 온 시민이 한마음으로 결집되는 광주대통합을 바탕으로 세계속에 우뚝서는 첨단산업의 도시, 문화예술의 도시로 만들어 나가고자 합니다.
그 가운데, 예향과 의향의 지역특성, 월드컵 4강신화 창출도시라는 성과를 적극 활용하여 국제적인 문화관광도시로 발전하고자 합니다.
그러나, 저 혼자 힘으로는 이러한 꿈을 이룰수 없습니다. 특히 지역의 예술인 여러분께서 광주가 세계적인 문화예술의 도시가 될 수 있도록 중지를 모아주실 것을 당부드립니다.
우리 시로서도 시민 여러분께서 문화를 향유하고 삶을 풍요롭게 가꿀수 있도록 문화예술의 창작·전시·공연활동을 적극 지원할 것입니다.
이제 우리는 새 시대를 향한 대장정을 힘차게 시작했습니다
저는 6천여 공직자와 함께 대열의 최선봉에 서서 우리 광주가 다가오는 서남해안 시대의 중심도시로 발전해 나갈 수 잇도록 최선을 다할 각오입니다.
시민 여러분께서도 위대한 빛의 도시로 새역사 창조에 앞장서 나간다는 의지를 새롭게 가다듬고 광주발전을 위해 다함께 동참해 주시기를 바랍니다.
끝으로, 한국이 낳은 세계적인 피아니스트, 서혜경씨의 아름다운 연주속에서 민선 3기 광주의 새로운 미래, 힘찬 출발을 염원하는 광주시민의 마음이 하나로 묶여지기를 바랍니다.
감사합니다.
',null,'A','admin','211.253.121.18',0)
/
INSERT INTO TG_SCRIPT
  (SEQ_NO,DAY,CATE_CODE,TITLE,TITLE_CATE,TYPE_CODE,DEPT_CODE,WRITER,REMARKS,DOCUMENT,FILE_NAME,SEAR_RANK,ADMIN_ID,WRITE_IP,VIEW_CNT)
VALUES(3372,'20020714','AC20','제1회 전국아마추어 댄스스포츠선수권대회','자','AT01','AD01','나하나',null,' ''제1회 전국아마추어 댄스스포츠선수권대회''가 우리 광주에서 처음 열리게 된 것을 대단히 뜻깊게 생각합니다.
먼저, ''꿈이 있는 빛고을, 우리 모두가 주인''인 광주를 방문하여 주신 선수와 지도교사 여러분을 진심으로 환영합니다. 그동안 오늘의 열전을 위해 연습하느라 참으로 고생 많으셨습니다.
청소년을 대상으로 처음 개최되는 대회이니 만큼, 본 대회는 댄스스포츠계의 저변을 확대하고 그 위상을 높일수 있을 것으로 기대가 됩니다.
불과 몇년전만 해도 생소했던 댄스스포츠가 이제는 올림픽의 정식종목 채택을 눈앞에 두고 있다 합니다. 댄스스포츠는 짧은 보급기간에도 불구하고, 그동안 국민들의 몸과 마음을 건강하게 하고  건전한 여가문화를 창조하는 데에도 기여해 왔습니다.
이처럼 댄스스포츠의 발전에 힘써오시면서 이번 대회를 주관하느라 노고가 크셨던 (사)대한댄스스포츠연맹의 박순희 총재와 광주연맹의 서영상, 나수경 회장님을 비롯한 관계자 여러분에게도 감사를 드립니다.
러분이 찾아주신 이곳 광주는 쾌적한 환경속에 전통문화가 발달한 예술의 고장입니다. 또한, 우리나라의 민주화를 앞당긴 5·18민주화운동이 일어난 의로운 도시입니다.
특히, 참가자 여러분께서도 대회장소에 오시면서 보셨겠습니다만, 이곳은 5·18기념공원입니다. 이 공원은 5·18묘지와 5·18자유공원과 함께 5·18의 역사적인 의미를 되새기기 위해 전국 각지에서 많은 이들이 찾는 사적지 가운데 하나입니다.
우리 광주는 또한, 2002 한일 월드컵 개최도시로서 수준높은 시민의식으로 한국의 4강신화가 창출된 도시이기도 합니다.
우리 시를 방문하신 여러분께서 이러한 광주를 기억하여 주시기 바라며, 光산업, 디자인산업이라는 첨단산업과 격조높은 문화예술이 조화롭게 발전하고 있는 우리 광주의 변화된 모습을 보고 가신다면 더욱 알찬 여정이 되리라 믿습니다.
시민 여러분께서도 멋진 포즈가 펼쳐질 때마다 힘찬 성원의 박수를 보내주시고, 광주에 대해 좋은 이미지를 가지고 돌아갈 수 있도록 정성껏 환대해 주시기를 부탁드립니다.
끝으로, 이 대회로 댄스 스포츠가 더욱 발전하고 청소년들의 건전한 정서함양에도 기여하는 계기가 되기를 바라면서, 오늘 뜻깊은 대회를 주관해주신 관계자 여러분의 노고에 다시 한번 감사를 드립니다. 출전 선수 여러분의 건승을 기원합니다. 감사합니다.
',null,'A','admin','211.253.121.18',0)
/
INSERT INTO TG_SCRIPT
  (SEQ_NO,DAY,CATE_CODE,TITLE,TITLE_CATE,TYPE_CODE,DEPT_CODE,WRITER,REMARKS,DOCUMENT,FILE_NAME,SEAR_RANK,ADMIN_ID,WRITE_IP,VIEW_CNT)
VALUES(3370,'20020710','AC37','중국 고서화초대전','자','AT08','AD01','나하나',null,' 먼저, 한중수교 10주년을 기념하는 중국 고서화초대전이 우리 광주에서 열리게 된 것을 매우 뜻깊게 생각합니다.
양국의 문화교류를 위해 방문해 주신 팽소준 서화가님을 비롯한 중국의 예술인 여러분, 전시를 지원해주신 중국의 영성일보 관계자 여러분에게도 감사를 드립니다.
한국과 중국은 지난 수 천년 동안 밀접한 교류와 유대 관계를 맺어 왔으며, 1992년 수교 이후에는 정치·경제·문화 등 모든 분야에서 더욱 성숙한 관계로 발전되어 오고 있습니다.
우리 광주시는 꽝저우시와 지난 1996년 자매결연을 맺은 이후 짧은 기간이지만, 다양한 교류를 통하여 상호 우호관계를 돈독히 해오고 있습니다.
이처럼 지방정부간의 교류가 확대 되어가는 과정에서, 우리 시민들이 천년 세월을 뛰어넘어 당, 송대의 서화작품과 현대 중국의 미술을 한눈에 볼수 있는 행사가 열려 참으로 반갑게 생각합니다.
번 전시가 양국의 특징을 이해하고 문화교류를 더욱 활성화하는 계기가 될 것으로 믿으면서, 소중한 행사를 마련하느라 노고가 크셨던 전남매일신문사와 주한 중국 대사관 관계인사 여러분에게 감사를 드립니다.
끝으로, 방문단 여러분께서 한국의 藝鄕, 義鄕, 味鄕이자, 이번 월드컵에서 한국 대표팀의 4강신화가 창출된 역사적인 도시이기도 한 우리 광주를 기억해주시고 널리 홍보해주시기를 부탁드리면서 전시가 성황을 이루기를 기원합니다.
',null,'A','admin','211.253.121.18',0)
/
INSERT INTO TG_SCRIPT
  (SEQ_NO,DAY,CATE_CODE,TITLE,TITLE_CATE,TYPE_CODE,DEPT_CODE,WRITER,REMARKS,DOCUMENT,FILE_NAME,SEAR_RANK,ADMIN_ID,WRITE_IP,VIEW_CNT)
VALUES(3369,'20020710','AC50','세계한민족과학기술자 종합학술대회','사','AT01','AD04','나하나',null,' 존경하는 채영복 과학기술부장관님, 신국환 산업자원부 장관님, 양승택 정보통신부 장관님을 비롯한 내외 귀빈 여러분! 그리고 과학자 여러분!
과학기술의 수준이 국가발전의 척도가 되는 이때, ''세계한민족과학기술자 종합학술대회''와 ''한미과학기술자 국제 심포지엄''이 열리게 된것을 매우 뜻깊게 생각합니다.
특히, 광주광역시에 대해 소개할 기회를 갖게 되어 참으로 영광스럽게 생각합니다. 대회처음으로 광산업분야 세션을 구성하고, 홍보관을 설치할수 있도록 협조해주신 한국과학기술단체총연합회 김시중회장님께 감사 드립니다.
광주는 쾌적한 환경속에 전통문화가 발달한 예술의 고장이요, 한국의 민주화를 앞당긴 인권의 도시입니다.
이러한 전통과 더불어 21세기 지식기반시대를 맞이하여 전문고급인력을 많이 배출시키고 있는 우리 시에서는 용어조차 생소했던 광산업을 이 시대의 첨단산업으로 주목하고 99년부터 착실하게 준비를 하고 있습니다.
빛의 도시 光州라는 이름처럼, 광산업육성의 최적지라는 자신감으로 ''광산업육성 및 집적화계획''을 수립하였으며, 정부에 지원을 적극 건의한 결과, 2000년에 국가지원사업으로 책정되었습니다.
우선, 1단계로 총사업비 4,020억원을 들여 광산업진흥회, 광기술원을 개원하여 지원체제를 구축하였고, 한국전자통신연구원 광통신부품연구센터와 고등광기술연구소 등 국책연구기관이 광주에 설립되면서 광산업 육성의 토대를 마련했습니다.
또한 4만5천평에 광산업집적화단지를 조성한데 이어, 외국인기업전용단지 10만평을 추가로 확보하는 등 투자여건이 호전되면서 99년 47개였던 광관련기업이 3년만에 143개로 늘어났습니다.
아울러, 지난해 9개국 120개 업체가 참가한 ''국제광산업전시회''를 광주에서 성황리에 개최하였으며, 올해 9월에는 서울 COEX에서 전시회를 열 계획입니다.
앞으로도, 우리시는 광통신부품, 광정밀기기, 광원, 광소재 분야를 중점 육성해 나가면서, 정부와 공동으로 2단계사업 추진에 따른 전문기관 용역을 실시할 것입니다.
히, 외자유치가 국가경쟁력 제고와 지역경제 활성화에 지름길이라는 확신을 갖고, 도로망등 SOC의 확충, 값싼 공장용지와 금융·세제지원 확대, 각종 규제완화, 건전한 노사문화정착 등 기업하기 좋은 여건을 마련하고 있습니다.
아울러, 광주는 2002한일월드컵에서 한국대표팀이 4강 진출을 이룩한 도시로서, 격상된 ''광주브랜드''를 최대한 활용하여 세계속에 우뚝 선 첨단산업의 도시, 문화예술의 도시가 되고자 합니다.
국내외 光관련업체가 이러한 광주에서 많이 창업·이전하기를 바라면서, 행사에 참여하신 과학기술자 여러분께서도 한국이 세계 5대 광선진국이 되는 데 견인차가 될 광주에 많은 성원을 보내주실 것을 기대합니다.
특히, 한국광산업진흥회가 모색하고 있는 민간교류 협력차원의 네트워크 구축에 적극 협조하여 주시기 바랍니다.
어서, 양해하여 주신다면 광산업의 육성에 대한 세부상황을 우리시 경제통상국장이 설명드리도록 하겠습니다.
이번 대회가 첨단과학기술의 향상과 광산업에 대한 관심을 높이는 계기가 되기를 빌면서, 여러분의 앞날에 무한한 영광과 축복이 함께 하시기를 기원합니다.
사합니다
',null,'O','admin','211.253.121.18',16)
/
INSERT INTO TG_SCRIPT
  (SEQ_NO,DAY,CATE_CODE,TITLE,TITLE_CATE,TYPE_CODE,DEPT_CODE,WRITER,REMARKS,DOCUMENT,FILE_NAME,SEAR_RANK,ADMIN_ID,WRITE_IP,VIEW_CNT)
VALUES(3371,'20020711','AC23','투명한 아파트관리를 위한 토론회','타','AT01','AD11','나하나',null,' 오늘, 전국아파트연합회 광주·전남지부에서 주관하는 "투명한 아파트 관리를 위한 경기·대구·부산지역 대표 토론회"가 열리게 된 것을 진심으로 축하드립니다.
평소 시정발전에 아낌없는 성원을 보내주시면서, 살기  좋은 아파트 문화를 만들기 위해 노고가 크셨던 강인태 지부장님, 입주자 대표회의 회장님, 부녀회장님, 관리소장님을 비롯한 입주민 여러분께 깊은 감사를 드립니다.
아울러, 바쁘신 가운데에도 주제발표를 해주시기 위해 광주를 방문해주신 수원, 대구, 부산지역의 아파트연합회 대표자 여러분을 진심으로 환영합니다.
잘 아시는 바처럼, 전세계를 깜짝 놀라게 하였던 월드컵에서의 한국팀 선전은 히딩크 감독이라는 지도자가 있었기에 가능하였습니다.
는 부정부패의 큰 원인인 연줄대신에 실력으로 선수를 선발하는 투명한 방식으로, 광주에서 4강 신화를 달성하였습니다. 이후로, 히딩크 감독의 마인드가 기업이나 사회 전반에 큰 반향을 일으키고 있습니다.
월드컵의 성공을 계기삼아 우리 사회도 부정부패의 고리를 끊고 국가신인도와 지역의 경쟁력을 높일수 있는 절호의 기회를 맞고 있는 것입니다.
이러한 시점에서, 기존의 주먹구구식인 아파트 관리방법을 투명하게 개선하여 살기좋은 아파트를 건설하자는 오늘의 토론회는 참으로 시의적절하다 생각합니다.
저는 이번 토론회가 투명하고 민주적인 아파트 관리로 건강한 아파트 문화를 형성하는 것은 물론이고, 부패없는 건강한 사회로 발전하는 계기가 될 것으로 믿습니다.
왜냐하면, 우리 시 전체가구의 70%가 넘는 아파트는  이제 단순히 주거공간에서 그치는 것이 아니라, 풀뿌리 민주주의의 기초조직으로서, 주민자치운동의 출발점이 되기 때문입니다.
리시도 투명한 행정절차를 확보하고 능력위주의 경쟁시스템을 도입하여 신뢰받는 행정을 구현하겠습니다.
이를 바탕으로 세계속에 우뚝서는 첨단산업의 도시, 문화예술의 도시로 만들어나가고자 합니다. 시민 여러분의 많은 성원과 협조를 당부드립니다.
이와 함께, 삭막하기만 했던 아파트단지에서 농산물 직거래장터가 세워지고, 경로잔치가 열리는 등 공동체문화가 꽃피고 있는 점도 반갑게 생각하면서, 지난 10년동안 살기좋은 아파트 만들기에 힘써오신 ''전국아파트연합회''관계인사 여러분에게 거듭 감사를 드립니다.
앞으로, 입주민의 참여속에서 아파트가 투명하게 관리되고 이웃과 더불어 살아가는 주거문화가 정착되기를 빌면서, 여러분 모두의 가정에 건강과 행운이 충만하시기를 기원합니다. 감사합니다.
',null,'O','prgwangju','102.1.2.108',10)
/
INSERT INTO TG_SCRIPT
  (SEQ_NO,DAY,CATE_CODE,TITLE,TITLE_CATE,TYPE_CODE,DEPT_CODE,WRITER,REMARKS,DOCUMENT,FILE_NAME,SEAR_RANK,ADMIN_ID,WRITE_IP,VIEW_CNT)
VALUES(3367,'20020706','AC28','제1회 심양김치대축제 개막식','자','AT01','AD01','나하나',null,' 오늘, 중국 동부지역의 중추도시인 심양시에서, 한중교류 10주년을 기념하는 한국주간 선포식과 제1회 김치대축제가 열리게 된 것을 진심으로 축하드립니다. 아울러, 우리 광주광역시를 초대하여 주신데 대하여 깊이 감사를 드립니다.
아시는 바대로 김치는 독특한 맛과 영양을 갖춘 한국의 대표적인 음식입니다. 최근에는 훌륭한 발효식품으로 과학적으로 그 가치가 입증되면서 세계인의 음식으로 부상하고 있습니다.
더욱이, 우리 광주는 드넓은 평야와 어종이 풍부한 바다가 옆에 있어 음식문화가 발달한 고장입니다. 광주 김치 또한 양념을 듬뿍 넣어 맛이 깊고 진하다고 정평이 나있습니다.
우리시는 이러한 김치를 관광자원화 해서, 94년부터 광주김치대축제를 개최하고 있으며, 지난해에는 40여만명의 관람객이 다녀가면서 한국의 우수축제로 선정되기도 하였습니다.
또한, 99년부터는 일본에서 김치축제를 개최함으로써, 한국김치의 정통성과 우수성을 널리 알려나가고 있습니다.
이러한 시점에서 중국에서 처음으로 김치의 맛과 한국의 문화가 선보이는 김치축제가 열리게 되어 참으로 반갑게 생각합니다.
특히, 이번 행사에서는 한국상품전람회와 투자유치설명회도 개최되기 때문에, 한중간 교류의 폭을 넓히고 심양과 광주, 양 지역의 발전을 견인하는 계기가 되리라 믿습니다.
심양 시민 여러분! 우리 광주는 한국을 대표하는 시인과 화가들이 많이 난 藝鄕이면서, 민주화를 앞당긴 5·18민중항쟁이 일어난 義鄕으로 이름높은 곳입니다.
이제는 첨단산업인 光산업의 집적화단지로서, 비엔날레와 김치대축제라는 국제적인 문화행사를 개최하고 있는 광주에 더욱 많은 관심을 가져주시기를 바랍니다.
끝으로, 김치의 국제화를 앞당길 이번 행사가 성황리에 개최되기를 빌면서 행사준비에 노고가 크셨던 심양시장님과 추진위원장님, 함께 해주신 여러분 모두의 가정에 건강과 행운이 함께 하시길 기원합니다.
감사합니다.
',null,'A','admin','211.253.121.18',1)
/
INSERT INTO TG_SCRIPT
  (SEQ_NO,DAY,CATE_CODE,TITLE,TITLE_CATE,TYPE_CODE,DEPT_CODE,WRITER,REMARKS,DOCUMENT,FILE_NAME,SEAR_RANK,ADMIN_ID,WRITE_IP,VIEW_CNT)
VALUES(3368,'20020708','AC12','제10회 여성대회','자','AT01','AD03','나하나',null,' 존경하는 은방희 한국여성단체협의회장님, 김광아 시협의회장님을 비롯한 여성 지도자 여러분! 23개 여성단체 회원여러분! 그리고 강운태 새천년민주당 시지부장님과 양형일 조선대학교 총장님을 비롯한 내빈여러분!
행사에 앞서, 시장이라는 중책을 맡을 수 있도록 성원해주신 여성 여러분께 고개숙여 감사를 드립니다.
오늘, 여성주간을 맞아 ''제10회 광주여성대회''가 열리게 된 것을 대단히 기쁘게 생각합니다. 영예의 ''무등여성대상''을 수상하신 안숙 금화여성회 이사장님과 선
여성대상의 첫 수상자이신 한재숙 광산구 방범과장님에게도 진심으로 축하를 드립니다.
아시는 바처럼, 지난 6·13지방선거에서는 여성당선자가 민선2기에 비해 50%나 늘어났습니다.
정치뿐 아니라 사회 전반적으로 여성들의 활동이 활발해지면서 오늘의 주제처럼 여성의 힘이 지역의 경쟁력이 되고 있습니다.
에는 정부나 우리시가 제도적으로 뒷받침한 이유도 있습니다만, 무엇보다 많은 난관을 뚫고 여성의 권리를 하나씩 찾아나간 여러분의 노력이 있었기에 가능한 일이었습니다. 그 노고에 깊은 경의를 표합니다.
그렇지만, 선진국에 비하면 아직도 할 일이 많습니다
또한 지난 2일, 취임식장에서 여성의 사회참여를 더욱 확대해나가겠다고 약속을 드렸습니다.
이를 위해, 우리시는 여성단체를 적극 지원하고 여성고용을 촉진하기 위한 방안을 마련하겠습니다. 육아부담으로 선진국보다 더 출산율이 낮은 세태를 개선하기 위해, 구별로 양질의 육아시설을 확충할 것입니다.
나아가, 우리 광주는 시민이 한마음이 된 대통합위에 첨단산업과 문화예술로 세계속에 우뚝 서고자 합니다.
는 선진시민운동의 축인 여성단체가 앞장서 주신다면, 그리고 70만 여성 여러분께서 지혜를 모아주신다면 일류도시의 꿈을 반드시 이룰 수 있다고 믿습니다.
오늘 행사가, 여성의 발전과 광주의 힘찬 출발을 준비하는 계기가 되기를 바라면서, 광주광역시 여성단체협의회의 무궁한 발전을 기원합니다.
감사합니다.
',null,'O','admin','211.253.121.18',61)
/
INSERT INTO TG_SCRIPT
  (SEQ_NO,DAY,CATE_CODE,TITLE,TITLE_CATE,TYPE_CODE,DEPT_CODE,WRITER,REMARKS,DOCUMENT,FILE_NAME,SEAR_RANK,ADMIN_ID,WRITE_IP,VIEW_CNT)
VALUES(3365,'20020704','AC37','한국현대구상미술협회 목우회 회원전 축사','하','AT01','AD01','나하나',null,' 청포도가 탐스럽게 익어가는 7월을 맞아, 한국현대구상미술협회 목우회의 제64회 회원전이 광주시립미술관과 공동주최로 열리게 된 것을 대단히 기쁘게 생각합니다.
아울러, 미술문화 발전에 헌신해오신 이태길 이사장님, 서봉한 광주지부장님과 회원 여러분께 깊은 감사를 드립니다.
사단법인 목우회는 1958년에 창립된 이래, 40년이 넘게 활발한 회원활동을 펼쳐왔습니다. 여러분의 정진으로 현대미술이 발달하고 시민정서도 윤택하여졌다 믿습니다.
이번 전시회도 그러한 오랜 전통과 깊이를 느낄 수 있는 원로·중견작가들의 작품들을 감상할수 있다는 점에서 큰 기대를 모으고 있습니다.
존경하는 미술인 여러분!
21세기 개혁과 변화의 시대에, 발전과 번영의 새로운 광주를 건설해야 하는 이 시점에서, 시장이라는 중책을 맡을 수 있도록 저를 지지하고 성원해주신 여러분께 깊은 감사를 드립니다.
저는 우리 광주를 온 시민이 한마음으로 결집되는 광주대통합을 바탕으로 세계속에 우뚝서는 첨단산업의 도시, 문화예술의 도시로 만들어 나가고자 합니다.
특히, 예향과 의향의 지역특성을 적극 활용하여 국제적인 문화관광도시로 발전하고자 합니다.
그러나, 저 혼자 힘으로는 이러한 꿈을 이룰수 없습니다. 특히 지역의 예술인 여러분께서 광주가 세계적인 문화예술의 도시가 될 수 있도록 중지를 모아주실 것을 당부드립니다.
여러분의 적극적인 협조와 동참이 있을 때 "꿈이 있는 빛고을 우리 모두가 주인"인 광주가 태어날 수 있을 것입니다.
아무쪼록, 이번 전시회가 큰 성황을 이루기를 빌면서, 뜻깊은 행사를 마련하신 ''한국현대구상미술협회 목우회''의 무궁한 발전을 기원합니다. 감사합니다.
',null,'A','admin','211.253.121.18',1)
/
INSERT INTO TG_SCRIPT
  (SEQ_NO,DAY,CATE_CODE,TITLE,TITLE_CATE,TYPE_CODE,DEPT_CODE,WRITER,REMARKS,DOCUMENT,FILE_NAME,SEAR_RANK,ADMIN_ID,WRITE_IP,VIEW_CNT)
VALUES(3363,'20020704','AC51','제4회 전국장애인게이트볼대회','자','AT02','AD03','나하나',null,' 안녕하십니까. 광주광역시장 박광태입니다.
먼저,''제4회  전국장애인 게이트볼대회''가 우리 광주에서 열리게 된 것을 대단히 뜻깊게 생각합니다. 시도대표선수단과 가족 여러분에게 따뜻한 환영의 인사를 드립니다.
아울러, 올해에도 전국규모의 큰 대회를  개최하느라 노고가 크셨던 강운태 대회장님과 이재홍 회장님,
적극 지원해주신 장기철 한국지체장애인협회 회장님을 비롯한 내빈에게도 깊은 감사를 드립니다.
최근 우리사회는 지식정보화의 물결속에 의료기술이 발달하면서, 신체적인 불편이 사회활동에 제약이 되는 경우가 줄고 있습니다. 정부와 자치단체에서도 장애인의 사회참여를 돕기 위해 힘쓰고 있습니다.
앞으로 여러분이 꿈을 갖고 적성을 살려간다면, 또 오늘처럼 열심히 뛴다면 자신은 물론이고 사회가 훨씬 밝고 건강해질수 있다, 저는 이렇게 믿습니다.
민선3기, 새롭게 시작된 우리 광주에도 큰꿈이 있습니다. 온 시민이 한마음이 되는 대통합위에 광주를 세계적인 첨단산업의 도시, 문화예술의 도시로 만들어가는 꿈입니다.
그러면서, 우리시는 장애인 여러분의 경제적 자활을 위해 직업기술교육과 자활센터 설립을 적극 지원할 것입니다.
그렇지만, 여러분의 협조와 동참이 없이는 이러한 꿈을 이룰 수 없습니다. 월드컵 4강신화도 전 국민이 똑같은 꿈을 꾸었기에 가능한 일이었습니다.
우리 광주가 꿈을 현실로 만들 수 있도록, 시민 여러분께서 많은 성원을 보내주시기를 당부드립니다.
우리 한국이 이번 월드컵을 맞아 많은 갈등을 극복하고 국민대화합의 계기를 마련했듯이, 오늘 대회도 장애여부나 지역, 나이를 떠나서 하나되는 장이 되리라 봅니다.
아무쪼록, ''꿈이 있는 빛고을, 우리 모두가 주인''인 광주에 머무르시는 동안 편안한 여정이 되기를 빌면서 여러분 모두의 앞날에 건강과 행운이 함께 하시기를 기원합니다. 감사합니다.
',null,'A','admin','211.253.121.18',0)
/
INSERT INTO TG_SCRIPT
  (SEQ_NO,DAY,CATE_CODE,TITLE,TITLE_CATE,TYPE_CODE,DEPT_CODE,WRITER,REMARKS,DOCUMENT,FILE_NAME,SEAR_RANK,ADMIN_ID,WRITE_IP,VIEW_CNT)
VALUES(3364,'20020704','AC12','제4회 평등부부상 시상식','자','AT01','AD03','나하나',null,'오늘, 우리 고장에서 ''제4회 평등부부 시상식''이 열리게 된 것을 매우 뜻깊게 생각하면서, 평등한 가정을 일구어 건강한 사회발전의 토대를 닦아오신 공로로 영예의 평등부부상을 안으신 수상자부부에게 뜨거운 축하의 박수를 보냅니다.
아울러, 평소 그리스도의 사랑으로 지역사회의 화합과 나라발전에 힘써 오시면서, 이처럼 뜻깊은 행사를 마련해주신, 장혜숙 회장님과 Y가족 여러분에게 깊은 감사의 말씀을 드립니다.
잘 아시는 바처럼, 글로벌 경쟁시대를 맞아 세상의 절반인 여성의 인권을 보장하고, 여성이 능력을 맘껏 발휘할수 있도록 여건을 조성하는 일은, 국가경쟁력을 키우는데 선결요건이 되고 있습니다.
따라서, 정부는 물론 우리시에서도 여러분과 함께 남녀평등의 사회를 만들고 여성의 지위를 향상시키기 위한 많은 노력을 기울여왔습니다. 그러나, 아직도 선진국에 비하면 여성의 취업률이나 권한척도에서 많은 차이가 나고 있습니다.
우리가 지향하는 남녀평등사회로 가는 지름길은 평등한 부부관계에서 출발하며, 평등가정의 자녀들이 자연스럽게 평등시민, 민주시민이 된다는 점을 누구나 공감하실 것입니다.
그렇지만, 평등가정은 복잡하게 얽힌 가족관계속에서 실천이 그리 쉽지 않다는 점에서, 평등부부를 선정하고 그 행적을 널리 알리는 오늘의 행사는 참으로 의미가 깊다고 생각합니다.
많은 부부들에게 ''평등부부''가 귀감이 되어 남녀평등의식이 사회 전반에 뿌리내리는 성과로 이어지기를 바랍니다.
존경하는 Y가족 여러분!
선3기 시장이라는 중책을 맡을 수 있도록 저를 지지하고 성원해주신 YWCA가족 여러분께 진심으로 감사를 드립니다. 저는 지난 선거과정에서 ''남녀가 동등한 대우를 받는 평등사회를 실현하겠다''는 약속을 공약으로 제시한 바 있습니다.
이를 위해, 각종 위원회에 여성이 30%이상 참여할수 있도록 하고, 여성발전기금을 여성의 활동기반을 강화하는데 효율적으로 운용하겠습니다. 실질적으로 여성이 사회에 참여하는 기회를 늘리기 위해 그 창구가 되는 여성단체를 적극 지원할 것이며, 여성의 경제활동을 지원하는 고용촉진방안을 마련할 것입니다.
이러한 저의 공약이 결실을 맺을 수 있도록 여성계 지도자 여러분의 많은 관심과 적극적인 지원을 당부드립니다.
나아가, 첨단산업과 문화예술로 세계와 당당히 경쟁하는 광주를 만들고자 하는 민선 3기 시정에, Y가족 여러분께서 많은 성원을 보내주시기를 간곡히 당부드립니다.
오늘의 평등부부에게 거듭 축하를 드리면서, 여러분 모두의 앞날에 건강과 행운이 함께 하시기를 기원합니다. 감사합니다.
',null,'O','admin','211.253.121.18',11)
/
INSERT INTO TG_SCRIPT
  (SEQ_NO,DAY,CATE_CODE,TITLE,TITLE_CATE,TYPE_CODE,DEPT_CODE,WRITER,REMARKS,DOCUMENT,FILE_NAME,SEAR_RANK,ADMIN_ID,WRITE_IP,VIEW_CNT)
VALUES(4239,'19911017','AC54','기업체대표자 간담회','가','AT01','AD15','최영수',null,'
1991. 10. 17
아침저녁으로 제법 쌀쌀한 기운이 감도는데 이렇게 밝고 건강한 모습으로 뵙게 되어 기쁘기 그지없습니다.
여러 가지 어려운 여건 속에서 지역경제 활성화와 국가경제발전에 헌신하고 계시는 기업체 대표자 여러분께 사의와 경의를 표합니다.
오늘 이렇게 경제의 어려움을 극복하고 생산성 향상을 위한 대화의 장을 갖게 된 것은 우리 사회에 만연된 사치, 과소비 풍조와 땀흘려 일하기 싫어하는 현실을 바로 보고 시에서 중점 추진 중에 있는 불건전한 과소비 추방의 일환인 씀씀이 줄이기 운동에 적극적인 협조와 참여를 구하고자 함이며, 기업의 10% 경비절감으로 경쟁력을 높이고 우리 경제가 당면하고 있는 어려움을 해결하고자함입니다.
존경하는 여러분께서 저희 시의 입장을 십분 이해하셔서 기업체의 생산비 절감에 있어서는 전사원 모두가 손쉬운 일에서부터 소비와 지출을 보다 알뜰하고 내실 있게 하며 10% 경비절감으로 경쟁력을 높여 우리 경제가 당면하고 있는 물류안정과 경제활성화에 기여해 주시고 우리 사회에 불건전한 과소비 풍조의 확산을 막음으로써, 재도약의 기틀을 마련해 주시기 바랍니다.
하시는 사업의 번창하심과 건승을 기원합니다.
',null,'A','prgwangju','102.1.2.127',1)
/
INSERT INTO TG_SCRIPT
  (SEQ_NO,DAY,CATE_CODE,TITLE,TITLE_CATE,TYPE_CODE,DEPT_CODE,WRITER,REMARKS,DOCUMENT,FILE_NAME,SEAR_RANK,ADMIN_ID,WRITE_IP,VIEW_CNT)
VALUES(4238,'19911012','AC54','중화민국 통계시찰단 시방문','자','AT01','AD15','최영수',null,'오늘은 국제 간 상호교환 방문의 일환으로 통계시찰단 여러분이 예향인 우리 광주를 방문한 것을 매우 뜻깊게 생각하며 우리 시청을 찾아주신 송윤증 단장을 비롯한 여러분을 진심으로 환영합니다.
한·중간의 전통적인 우호증진을 위해서 여러 가지 행사가 국교수립 후 활발하게 전개되어, 양국 간의 협력과 연대가 더욱 요청되고 있는 시기인 만큼 이번 행사는 그 의미가 한층 깊다 하겠습니다.
광주 소개(전통예향, 충절의 고장, 인정과 여유의 밝은 심성 지닌 살기 좋은 도시, 120만 인구, 한국의 5대 도시임)
아무쪼록 이번 방문이 통계업무의 발전을 위한 비교시찰과 정보교환을 통해 경제협력을 증진하고 한·중 연대를 더욱 강화하는 계기가 되기를 희망합니다.
여러분의 광주방문이 큰 성과의 수확을 기대하며 한국에 머무시는 동안 건강·행운 소원 드립니다.
',null,'A','prgwangju','102.1.2.127',0)
/
INSERT INTO TG_SCRIPT
  (SEQ_NO,DAY,CATE_CODE,TITLE,TITLE_CATE,TYPE_CODE,DEPT_CODE,WRITER,REMARKS,DOCUMENT,FILE_NAME,SEAR_RANK,ADMIN_ID,WRITE_IP,VIEW_CNT)
VALUES(4240,'19911109','AC54','한국노인회 광주직할시연합회 대표자교육','하','AT01','AD15','최영수',null,'존경하는 문인걸 회장님!
그리고 자리를 함께 해주신 지도자 여러분
풍요로운 결실의 계절을 맞아 대한노인회 백창현 부장님을 모시고 개최되는 대한 노인회 광주직할시연합회 지도자 교육을 매우 뜻깊게 생각하면서 진심으로 축하드립니다.
저는 평소 어르신 여러분이야말로 풍부한 인생경험과 지혜를 바탕으로 우리 사회가 보다 더 발전되도록 보살펴 주시고 이끌어 주시는 이 시대의 부모이시고 공로자이시며 원로이시다는 확신을 갖고 있습니다.
이 자리를 빌어 노인회가 사회봉사와 지역발전에 공헌하는 사회봉사단체로서 확고하게 자리할 수 있도록 헌신, 노력해 오신 여러분께 경의를 표하면서 오늘 교육에 뜨거운 성원과 힘찬 격려를 보내는 바입니다.
아시다시피 지금 우리 사회는 전통윤리 도덕이 퇴조하는 한편, 서구의 개인주의 문화와 급속한 산업사회 진전에 따라 황금만능사조의 만연으로 가치관의 혼돈이 사회를 어둡게 하고 있습니다.
폭력, 인신매매와 같은 인간성 상실현상과 과소비, 퇴폐향락 풍조와 같은 사회병리현상 그리고 급진적 주장과 과격한 욕구분출에 의한 사회갈등현상이 우리 사회를 심각한 위기 상황에 이르게 하고 있습니다.
이제 우리는 이러한 비도덕적 풍조와 반윤리적 행위를 우리 사회에 발붙이지 못하도록 이를 과감히 척결해 나가야 하겠습니다.
그러한 점에서 우리 사회의 원로이신 어르신 여러분의 앞장선 노력으로 가정에서부터 우리가 살고 있는 고장과 사회전반에 까지 보다 맑고 밝은 사회기풍이 정착되어 건전한 사회를 앞당기는데 초석이 되어 주시기 바랍니다.
아무쪼록 오늘 교육을 통하여 우리가 당면하고 있는 시대적 요구에 대한 인식을 새롭게 가다듬고 노인지도자로서의 전문성과 지도기법을 함양하게 되기를 기대합니다.
다시 한번 어르신 여러분의 지도력 함양에 일조가 될 지도자교육에 아낌없는 성원과 격려를 보내면서 광주직할시노인연합회의 무궁한 발전을 기원합니다.
여러분! 늘 건강하시고 행운이 가득하셔서 행운이 가득하셔서 보람된 나날 되시길 빕니다.
감사합니다.
',null,'A','prgwangju','102.1.2.127',0)
