DECLARE
  l_lookup_id    number;
  l_create_date  DATE;
BEGIN
  FOR i IN 1 .. 100000 LOOP
    IF MOD(i, 3) = 0 THEN
      l_create_date := ADD_MONTHS(to_date('20091230','YYYYMMDD'), -24);
      l_lookup_id   := 2;
    ELSIF MOD(i, 2) = 0 THEN
      l_create_date := ADD_MONTHS(to_date('20091230','YYYYMMDD'), -12);
      l_lookup_id   := 1;
    ELSE
      l_create_date := to_date('20091230','YYYYMMDD');
      l_lookup_id   := 3;
    END IF;
    INSERT INTO big_table2 (id, created_date, lookup_id, data) VALUES (i, l_create_date, l_lookup_id, 'This is some data for ' || i
);
  END LOOP;
  COMMIT;
END;
